import { PubSub } from 'apollo-server';
import { joinFrom } from './../util/joinFrom';
import { ApolloDatabaseDocument, ApolloDatabaseDocumentMember, SubscriptionTypes, ApolloDatabaseUser } from './../resolvers';
import { Document as ApolloDocument, InvitedUserInput, NewDocumentInput, NewAnnotationInput } from './../../../../types/resolvers-types';
import { Base } from './Base';
import { Annotation } from './Annotation';
import { Context } from '../resolvers';
import { DocumentMember } from './DocumentMember';
import getUsersListFromEmail from '../util/getUsersListFromEmail';
import { Actions, Roles, AuthMethod, AuthorizeFunction } from '../util/permission';
import { createEntity } from '../entity';
import { TIMESTAMP } from '../util/timestamps';
import logger, { Tags } from '../../../../shared/log/logger';
import { throwError } from '../../../../shared/errors';
import { RequestedFields } from '../util/getRequestedFields';

export type DocumentPublishEventOptions = {
  markedAllAsRead?: boolean
}

export class Document extends Base<
  ApolloDatabaseDocument,
  ApolloDocument,
  {
    members: DocumentMember[];
    annotations: Annotation[];
    unreadCount: number;
  }
> {
  constructor(document: ApolloDatabaseDocument, userId: string, from: string, context: Context) {
    super({
      name: 'Document',
      entity: document,
      from,
      context,
      getters: {
        members: async () => {
          const result = (await context.resolvers.Query.documentMembers({ documentId: document.id })).map((a) => new DocumentMember(a, joinFrom(from, 'getters.members'), context))
          return result;
        },
        annotations: async () => {
          const result = (await context.resolvers.Query.annotations({ documentId: document.id })).map((a) => new Annotation(a, userId, joinFrom(from, 'getters.annotations'), context));
          return result
        },
        unreadCount: async () => {
          const membership = (await context.resolvers.Query.documentMembers({ documentId: this.id, userId }))?.[0];
          if (!membership) {
            return 0;
          }

          const count = await context.resolvers.Query.annotationCount({
            documentId: this.id,
            since: membership.createdAt
          });

          if (typeof count !== 'number') {
            throw new Error("'annotationCount' resolver did not return an integer.")
          }

          const membershipCount = await context.resolvers.Query.annotationMemberCount({
            userId: userId,
            documentId: this.id,
            since: membership.createdAt
          });

          if (typeof membershipCount !== 'number') {
            throw new Error("'annotationMemberCount' resolver did not return an integer.")
          }
          return count - membershipCount;
        }
      },
      authorize: async (action: Actions, context: Context) => {
        const permission = context.permissionSetting.document;
        if (action === 'add') {
          const allow = await this.checkPermission(permission.add, context);
          if (!allow) {
            const errMsg = 'Permission denied: User does not have the permission to add a document.';
            throwError('Document.authorize', errMsg);
          }
        }
        if (action === 'read') {
          if (!this.getEntity().isPublic) {
            const allow = await this.checkPermission(permission.read, context);
            if (!allow) {
              const errMsg = 'Permission denied: User does not have the permission to view the document.';
              throwError('Document.authorize', errMsg);
            }
          }
        }
        if (action === 'edit') {
          const allow = await this.checkPermission(permission.edit, context);
          if (!allow) {
            const errMsg = 'Permission denied: User does not have the permission to edit the document.';
            throwError('Document.authorize', errMsg);
          }
        }
        if (action === 'delete') {
          const allow = await this.checkPermission(permission.delete, context);
          if (!allow) {
            const errMsg = 'Permission denied: User does not have the permission to delete the document.';
            throwError('Document.authorize', errMsg);
          }
        }
        if (action === 'invite') {
          const allow = await this.checkPermission(permission.invite, context);
          if (!allow) {
            const errMsg = 'Permission denied: User does not have the permission to invite other users.';
            throwError('Document.authorize', errMsg);
          }
        }
      },
      update: async (newEntity) => await context.resolvers.Mutation.editDocument(newEntity.id, newEntity),
      remove: async (id) => {
        const annotations = await this.getCalculated('annotations');
        const members = await this.getCalculated('members')

        await Promise.all(
          members.map(async (member) => {
            return await member.delete();
          })
        );

        await Promise.all(
          annotations.map(async (annot) => {
            return await annot.delete();
          })
        );

        return await context.resolvers.Mutation.deleteDocument(id);
      }
    });
  }

  async publishEvent(pubsub: PubSub, action: 'INVITE' | 'EDIT' | 'ADD' | 'DELETE', options: DocumentPublishEventOptions = {}) {
    const members = await this.getCalculated('members');
    const connectedUsers = await this.context.connectedUsers;
    const keys = Array.from(connectedUsers.getAllConnectedUsers());
    //property name in subscriptionFields should be identical with the operation name in packages/collab-client/src/graphql/subscriptions/documentChanged.ts
    const documentChangedRequestedFields = this.context.subscriptionFields['OnDocumentChanged'];
    const docEntity = this.getEntity();
    const docs = [];
    if(docEntity.isPublic) {
      const connectedDocUsers = connectedUsers.getConnectedUsersForDocument(docEntity.id);
      for (const { userId } of connectedDocUsers) {
        docs.push({ doc: await this.getDocumentForUser(userId, documentChangedRequestedFields), userId });
      }
    } else {
      for (let i = 0; i < members.length; i++) {
        const userId = await members[i].get('userId');
        if (keys.includes(userId)) {  
          docs.push({ doc: await this.getDocumentForUser(userId, documentChangedRequestedFields), userId });
        }
      }
    }

    const promises = docs.map(async ({ doc, userId }) => {
      pubsub.publish(SubscriptionTypes.DOCUMENT_CHANGED, {
        documentChanged: {
          document: await doc.resolveAsEntity(),
          markedAllAsRead: options.markedAllAsRead,
          action,
        },
        userId
      });
    })

    await Promise.all(promises)
  }

  async getResolvedMembers(): Promise<(ApolloDatabaseDocumentMember & { user: ApolloDatabaseUser })[]> {
    const members: (ApolloDatabaseDocumentMember & { user: ApolloDatabaseUser })[] = []
    const docMembers = await this.getCalculated('members');
    for (let i = 0; i < docMembers.length; i++) {
      const user = await docMembers[i].getCalculated('user');
      members.push({
        ...docMembers[i].getEntity(),
        user: user.getEntity()
      })
    }
    return members;
  }

  async getUserMembership(userId) {
    const member = (await this.context.resolvers.Query.documentMembers({ documentId: this.id, userId }))?.[0];
    return member;
  }

  async getDocumentForUser(userId, requestedFields: RequestedFields) {
    const newDocument = new Document(this.getEntity(), userId, 'Document.getDocumentForUser', {...this.context, requestedFields});
    return newDocument;
  }

  async checkPermission(authMethods: Array<AuthMethod> | AuthMethod, context: Context): Promise<boolean> {
    let allowed = false;
    const currentUserId = context.user?.id;
    const isAuthor = this.getEntity().authorId === currentUserId;
    if (!Array.isArray(authMethods)) {
      authMethods = [authMethods];
    }
    const currentUser = await this.context.resolvers.Query.user(currentUserId);
    for (let i = 0; i < authMethods.length; i++) {
      //OR op on all auth methods
      const authMethod = authMethods[i];
      if (typeof authMethod === 'string') {
        if (authMethod === Roles.ANY) {
          return true;
        }
        if (!currentUser) {
          allowed ||= false;
          continue;
        }
        if (authMethod === Roles.DOCUMENT_AUTHOR) {
          allowed ||= isAuthor;
        }
        if (authMethod === Roles.DOCUMENT_MEMBER) {
          if (isAuthor) {
            allowed ||= true;
          } else {
            const currentUserMember = await this.getUserMembership(currentUser.id);
            allowed ||= !!currentUserMember;
          }
        }
      } else {
        const authFunction = authMethod as AuthorizeFunction;
        allowed ||= await authFunction(this.getEntity(), currentUser);
      }
    }
    return allowed;
  }

  async addUsers(usersInvited: InvitedUserInput[], currentUserId?: string) {
    const now = TIMESTAMP;
    const documentId = this.id;
    const users = await getUsersListFromEmail(usersInvited, 'Document.addUsers', this.context);
    const isSelfInvite = this.getEntity().isPublic && users.length === 1 && users[0].id === currentUserId;

    //allow self invite for public document
    if(!isSelfInvite) {
      await this.getAuthFunction()(Actions.INVITE, this.context);
    }
    await Promise.all(
      users.map(async (user) => {
        const lastRead = user.id === currentUserId ? now : 0;
        const docMember = await DocumentMember.create(user.id, documentId, lastRead, 'Document.addUsers', this.context);
        return docMember;
      })
    );

    return {
      isSelfInvite
    };
  }

  static async buildFromId(id: string, userId: string, from: string, context: Context) {
    const document = (await context.resolvers.Query.documents({ ids: [id] }))?.[0];
    if (!document) return null;
    try {
      const doc = new Document(document, userId, joinFrom(from, `Document.buildFromId(${id})`), context);
      return doc;
    } catch (e) {
      return null;
    }
  }

  static async create(document: NewDocumentInput, annots: NewAnnotationInput[] = [], usersInvited: InvitedUserInput[] = [], from: string, context: Context) {
    const entity = await createEntity<ApolloDocument, 'members' | 'annotations' | 'unreadCount'>(document);
    logger.debug(`New Document Entity created:`, { tag: Tags.ENTITY, meta: entity });
    const temp = new Document(entity, document.authorId, 'Document.create', context);

    //check permission
    await temp.getAuthFunction()(Actions.ADD, context);
    let finalEntity;
    const doc = (await context.resolvers.Query.documents({ ids: [document.id] }))?.[0]; //check if document already exists in db.
    if(!doc) {
      finalEntity = await context.resolvers.Mutation.addDocument(entity); //Do not addDocument for existing documents in db
    } else {
      finalEntity = await context.resolvers.Mutation.editDocument(document.id, entity); //Make sure existing documents do not miss any properties
    }
    if(!finalEntity) {
      finalEntity = entity
    }

    const finalDocument = new Document(finalEntity, document.authorId, 'Document.create', context);

    const allInvites: InvitedUserInput[] = [...usersInvited, { id: document.authorId }];
    if (allInvites && allInvites.length > 0) {
      await finalDocument.addUsers(allInvites, await finalDocument.get('authorId'));
    }

    const newAnnots = await Promise.all(
      annots.map(async (annot) => {
        return (await Annotation.create({ ...annot, documentId: finalDocument.id }, joinFrom(from, 'Document.create'), context));
      })
    );
    finalDocument.setCalculated('annotations', newAnnots);

    const newDoc = finalDocument;
    return newDoc;
  }
}
